sources.styles\\Sass\\blocks\\_navbar.scss:
.navbar {
    padding: 50px 0;

    .navbar__wrapper {
        display: flex;
        color: white;
        justify-content: space-between;
        margin: 0 auto;
    
        .navbar__logo {
            color: white;
            text-decoration: none;
            display: flex;
            align-items: center;

            p , strong {
                padding: 0;
                margin: 0;
                font-size: 15px;
            }

            p {
                @include reg();
            }

            strong {
                @include extrabold();
            }

            img {
                height: 40px;
                width: 40px;
                margin-right: 10px;
                object-fit: none;
            }

        }

        .navbar__nav {
            
            a {
                @include bold();
                color: white;
                text-decoration: none;
                transition: 0.15s;
                font-size: 15px;
                margin-right: 50px;

                &:last-child {
                    margin-right: 0;
                }

                &:hover{
                    color: $blue;
                }
            }

            #nav__button {
                display: none;
            }

        }

        .navbar__button {
            @include reg();
            background-color: transparent;
            border: 1px solid white;
            border-radius: 8px;
            padding: 5px 18px;
            font-size: 13px;
            cursor: pointer;
            transition: 0.15s;

            a {
                text-decoration: none;
                color: white;
            }

            &:hover{
                background-color: white;
                a {
                    color: $blue;
                }
            }
        }

        .navbar__burger {
            color: white;
            cursor: pointer;
            display: none;
        }
    }
}

sources.styles\\Sass\\blocks\\_hero.scss:
.hero {
    padding: 120px 0 190px 0;

    .hero__wrapper {
        display: flex;
        justify-content: space-between;
        align-items: center;
        margin: 0 auto;
        flex-wrap: wrap;

        .hero__offer {
            
            .hero__h {
                @include extrabold();
                color: white;
                font-size: 52px;
                margin: 0;
            }

            .hero__p {
                @include reg();
                color: white;
                font-size: 16px;
            }

            .hero__button {
                @include bold();
                padding: 20px 40px;
                border: 1px solid transparent;
                border-radius: 8px;
                cursor: pointer;
                box-shadow: 0px 5px 5px 0px rgba(0, 0, 0, 0.15);
                transition: 0.15s;
                outline: none;

                a {
                    text-decoration: none;
                    color: white;
                }
                
                &:hover {
                    box-shadow: none;
                    transform: translateY(3px);
                }
            }
            .btn1 {
                background-color: $blue;
                color: white;
                margin-right: 30px;
            }
            .btn2 {
                a {
                    color: $blue;
                }
                background-color: white;
            }
        }

        .hero__modal-trigger {
            color: $blue;
            display: inline-block;
            background: url('../../images/video-prev-op0.png');
            background-repeat: no-repeat;
            background-size: cover;
            text-align: center;
            border: 2px solid $blue;
            border-radius: 8px;
            box-shadow: 0px 10px 10px 0px rgba(0, 0, 0, 0.15);
            width: 80%;
            max-width: 600px;
            transition: 0.5s;
            cursor: pointer;

            &:hover {
                color: $green;
            }

            i {
                font-size: 5rem;
                margin-top: 1em;
            }
            p {
                @include bold();
                text-transform: uppercase;
                font-size: 15px;
                margin-bottom: 4em;
            }

            @media (min-width: 769px) and (max-width: 1500px) {
                margin-top: 50px;
            }
        }

        .hero__video-modal {
            display: none; 
            position: fixed;
            padding-top: 150px;
            z-index: 1;
            left: 0;
            top: 0;
            width: 100%; 
            height: 100%; 
            overflow: auto;
            background-color: rgba(0,0,0,0.8);

            .close {
                position: absolute;
                top: 15px;
                right: 35px;
                color: #f1f1f1;
                font-size: 40px;
                font-weight: bold;
                transition: 0.3s;
                text-decoration: none;
                cursor: pointer;
                animation: scale 0.6s;

                &:hover , &:active {
                    color: #bbb;
                }

            }

            video {
                width: 150%;
                max-width: 600px;
                display: block;
                margin: auto;
                animation: scale 0.6s;
            }

            @keyframes scale {
                from {transform:scale(0)} 
                to {transform:scale(1)}
            }
          }
    }    
}

