sources.styles\\Sass\\blocks\\_contact.scss:
.contact {
    background-color: #fafafa;
    padding: 100px 0;

    .contact__wrapper {
        margin: 0 auto;
        text-align: center;

        .contact__title {
            margin-bottom: 55px;

            h1 {
                @include bold();
                font-size: 42px;
                color: $blue;
                margin-bottom: 15px;
            }
            p {
                @include reg();
                font-size: 15px;
                color: $gray;
            }
        }

        .contact__form {
            display: grid;
            grid-template-columns: 1fr 1fr;
            grid-template-rows: 1fr 1fr 1fr 1fr 1fr;
            column-gap: 40px;
            row-gap: 20px;
            margin: 0 auto;
            width: 60%;
            height: auto;

            textarea {
                resize: none;
            }

            .form, textarea {

                padding: 20px;
                background-color: transparent;
                border: 1px solid $blue;
                border-radius: 5px;
                margin: 0;
                outline: none; 

                &::placeholder {
                    @include reg();
                    color: $blue;
                }
            }

            textarea {
                grid-column-start: 1;
                grid-column-end: 3;
                grid-row-start: 3;
                grid-row-end: 6;
            }
            
            .contact__button {
                @include bold();
                background-color: $green;
                color: white;
                border: 1px solid transparent;
                border-radius: 8px;
                font-size: 13px;
                transition: 0.15s;
                justify-self: end;
                align-self: center;
                width: 130px;
                height: 50px;
                cursor: pointer;

                box-shadow: 0px 5px 5px 0px rgba(0, 0, 0, 0.15);

                &:hover {
                    box-shadow: none;
                    transform: translateY(3px);
                }
            }

            .subscribtion {
                display: flex;
                align-items: center;

                #subscribe {
                    @include reg();
                    font-size: 13px;
                    color: $blue;
                }

                #subscribtion {
                    appearance: none;
                    background-color: transparent;
                    border: 2px solid $blue;
                    border-radius: 4px;
                    padding: 7px;
                    outline: none;
                    margin-right: 10px;

                    &:checked {
                        background-color: $blue;
                    }
                }
            }    
        }
    }
}

sources.styles\\Sass\\blocks\\_footer.scss:
.footer {
    background-color: $blue;
    padding: 100px 0;
    
    .footer__wrapper {
        margin: 0 auto;
        display: flex;
        align-items: center;
        justify-content: space-between;

        .footer__about {

            .footer__logo {
                color: white;
                text-decoration: none;
                display: flex;
                align-items: center;
                margin-bottom: 55px;

                p , strong {
                    padding: 0;
                    margin: 0;
                    font-size: 15px;
                }

                p {
                    @include reg();
                }

                strong {
                    @include extrabold();
                }

                img {
                    height: 40px;
                    width: 40px;
                    margin-right: 10px;
                    object-fit: none;
                }
            }

            .footer__others {               

                a {
                    @include reg();
                    color: white;
                    text-decoration: none;
                    transition: 0.15s;
                    font-size: 13px;
                    opacity: .5;

                    &:hover{
                        opacity: 1;
                    }
                }

                .dot {
                    font-size: 25%;
                    margin-right: 20px;
                    margin-left: 20px;
                    color: white;
                }
            }
        }

        .footer__links {
            position: relative;

            .footer__nav {
                margin-bottom: 55px;

                a {
                    @include bold();
                    color: white;
                    opacity: 1;
                    text-decoration: none;
                    transition: 0.15s;
                    font-size: 15px;
                    margin-right: 50px;
        
                    &:last-child {
                        margin-right: 0;
                    }
        
                    &:hover{
                        opacity: .5;
                    }
                }
            }

            .footer__social {
                position: absolute;
                right: 0;

                a {
                    text-decoration: none;
                    margin-right: 30px;
                    color: white;
                    opacity: .5;
                    transition: 0.15s;

                    &:last-child {
                        margin-right: 0;
                    }
                    &:hover {
                        opacity: 1;
                    }
                }
            }
        }
    }
}

