//colors
@import './colors';

//fonts
@import 'fonts';

//navbar
@import './blocks/navbar';

//hero
@import './blocks/hero';

//easy
@import './blocks/easy';

//stats
@import './blocks/statistic';

//services
@import './blocks/services';

//testimonials
@import './blocks/testimonials';

//team
@import './blocks/team';

//contact us
@import './blocks/contact';

//footer
@import './blocks/footer';

//media query tablet landscape/laptop
@import './mediaqueries-lg';
@import './mediaqueries-l';

//media query tablets
@import './mediaqueries-t';

//media query mobile
@import './mediaqueries-m';

* {
    box-sizing: border-box;
}

body {
    margin: 0;
    padding: 0;
}

.header {
    background: url('../../images/header-bg.png');
    background-size: cover;
    background-repeat: no-repeat;
}

.navbar__wrapper, .hero__wrapper, .easy__wrapper, .services__wrapper, .testimonials__wrapper, .contact__wrapper, .footer__wrapper {
    max-width: 1440px;
    padding-right: 10px !important;
    padding-left: 10px !important;
}
